import React, { Component } from 'react';
import { Navbar, Button, Nav} from 'react-bootstrap';
import './App.css';

class App extends Component {
  render() {
    return(
      <Navbar collapseOnSelect expand="lg" bg="primary" variant="dark">
        <Navbar.Brand href="#home">Lunch Money</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav>
            <Nav.Link href="#pricing">Inventory</Nav.Link>
          </Nav>
          <Nav>
          <Button id="account-buttons" variant="outline-light">Sign Up</Button>
          <Button id="account-buttons" variant="outline-light">Login</Button>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  }
}

export default App;
